  setupPremiumDomainPage = function() {
    console.log("Setup premium domain page xx");
    if ($('#domain_name_register').length) {
      console.log("domain_name_reg");
      whoisCheck('domain_name_register', false);
    }
    if ($('#domain_name_transfer').length) {
      whoisCheck('domain_name_transfer', false);
    }
    $('#register_domain').click(function(e) {
      e.preventDefault();
      console.log("on register domain", $('#domain_name_register').val());
      if ($('#domain_name_register').length) {
        $('#premium-step-2a').hide();
        $('#register-details').text($('#domain_name_register').val());
        $('#d_domain').val($('#domain_name_register').val());
        if ($('#signup_name').length) {
          $('#d_name').val($('#signup_name').val());
        }
        return $('#premium-step-3a').show();
      } else {
        return $(this).parent().find('.domain-notice').text('Please choose an available domain to continue');
      }
    });
    $('#transfer_domain').click(function(e) {
      e.preventDefault();
      if ($('#domain_name_transfer').length) {
        $('#premium-step-2b').hide();
        $('#register-details').text($('#domain_name_transfer').val());
        $('#d_domain').val($('#domain_name_transfer').val());
        prefillTransferData();
        if ($('#signup_name').length) {
          $('#d_name').val($('#signup_name').val());
        }
        return $('#premium-step-3a').show();
      } else {
        return $(this).parent().find('.domain-notice').text('Please choose an existing domain to continue');
      }
    });
    return $('#submit_domain').click(function(e) {
      var form;
      e.preventDefault();
      form = $('#details_form');
      if (validateRegistrationDetails(form)) {
        console.log("REGISTRATION READY -- let's submit the form");
        showDetailsNotice('Submitting ...');
        return $.post(form.attr('action'), form.serialize(), function(res) {
          res = JSON.parse(res);
          console.log("AFTER SUBMIT !!! ", res);
          if (res.status === 'success') {
            $('#premium-step-3a').hide();
            $('#premium-step-4').show();
            return $('#domain_complete').attr('href', res.access_url);
          } else {
            return showDetailsNotice("Unable to proceed with payment -- email info@utl.io to proceed");
          }
        });
      }
    });
  };

