  /*
  	Allow ppl to signup to our mailer without purchasing the product.
  */


  setupMailerSignup = function() {
    var submitForm;
    submitForm = function() {
      var container, f, form, notice;
      form = $('#mailer_form');
      container = $('#mailer_container');
      notice = $('#mailer_notice').text('Submitting ...');
      container.hide();
      $.post(form.attr('action'), form.serialize(), function(res) {
        res = JSON.parse(res);
        console.log("MAILER FORM RESPONSE ", res);
        if (res.status === 'success') {
          return $('#mailer_notice').text('Thank you.');
        } else {
          return $('#mailer_notice').text(res.message);
        }
      });
      f = function() {
        container.fadeIn();
        container.find('.model-email').val('');
        return $('#mailer_notice').text('');
      };
      return setTimeout(f, 10000);
    };
    $('#mailer-submit').click(function(e) {
      e.preventDefault();
      return submitForm();
    });
    return $('#mailer_form').submit(function(e) {
      e.preventDefault();
      e.stopPropagation();
      submitForm();
      return false;
    });
  };

